import React from 'react';
import { BrowserRouter, Switch, Routes} from "react-router-dom";
import Home from './pages/Home';

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Routes path="/" component={Home}/>
      </Switch>
    </BrowserRouter>
  );
};

export default App;
